import React, { useState } from "react";
import axios from "axios";

function App() {
  const [url, setUrl] = useState("");
  const [result, setResult] = useState(null);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState("");

  const checkUrl = async () => {
    if (!url) {
      setError(">> ERROR: No URL entered");
      return;
    }

    setLoading(true);
    setError("");
    setResult(null);

    try {
      const res = await axios.get(
        `http://127.0.0.1:8000/predict-url?url=${encodeURIComponent(url)}`
      );
      setResult(res.data);
    } catch (err) {
      setError(">> ERROR: Backend not responding");
    }

    setLoading(false);
  };

  return (
    <div style={styles.page}>
      <div style={styles.card}>
        <h1 style={styles.title}>[ HACKER PHISHING SCANNER ]</h1>
        <p style={styles.subtitle}>Cybersecurity ML Engine v1.0</p>

        <input
          type="text"
          placeholder="http://target-url.com"
          value={url}
          onChange={(e) => setUrl(e.target.value)}
          style={styles.input}
        />

        <button onClick={checkUrl} style={styles.button}>
          EXECUTE SCAN
        </button>

        {loading && <p style={styles.scan}>>> Scanning...</p>}
        {error && <p style={styles.error}>{error}</p>}

        {result && (
          <div style={styles.resultBox}>
            <h2 style={styles.resultTitle}>[ SCAN REPORT ]</h2>

            <p style={styles.text}>
              <b>Classification:</b>{" "}
              <span
                style={{
                  color:
                    result.final_prediction === "Phishing"
                      ? "#ff4444"
                      : "#00ff99",
                }}
              >
                {result.final_prediction}
              </span>
            </p>

            <p style={styles.text}>
              <b>ML Output:</b> {result.ml_prediction}
            </p>

            <p style={styles.text}>
              <b>Confidence:</b> {(result.ml_probability * 100).toFixed(2)}%
            </p>
          </div>
        )}
      </div>
    </div>
  );
}

// ---------------- HACKING TERMINAL STYLES ----------------

const styles = {
  page: {
    minHeight: "100vh",
    background: "#000000",
    color: "#00ff99",
    fontFamily: "'Share Tech Mono', monospace",
    display: "flex",
    justifyContent: "center",
    alignItems: "center",
    padding: 20,
  },

  card: {
    width: "100%",
    maxWidth: "600px",
    padding: "32px",
    border: "1px solid #0aff7f",
    background: "rgba(0, 15, 0, 0.8)",
    boxShadow: "0 0 15px #00ff99, 0 0 40px rgba(0,255,120,0.25)",
  },

  title: {
    fontSize: "26px",
    marginBottom: "5px",
    textShadow: "0 0 10px #00ff99",
  },

  subtitle: {
    fontSize: "14px",
    marginBottom: "20px",
    color: "#66ffcc",
  },

  input: {
    width: "100%",
    padding: "12px",
    fontSize: "16px",
    borderRadius: "4px",
    border: "1px solid #00ff99",
    background: "#001a00",
    color: "#00ff99",
    marginBottom: "16px",
    outline: "none",
    fontFamily: "'Share Tech Mono', monospace",
  },

  button: {
    width: "100%",
    padding: "12px",
    fontSize: "16px",
    background: "#00ff99",
    border: "none",
    cursor: "pointer",
    fontWeight: "600",
    color: "#000000",
    marginBottom: "20px",
    fontFamily: "'Share Tech Mono', monospace",
  },

  scan: { color: "#66ffcc", fontSize: "16px" },

  error: { color: "#ff4444", fontSize: "16px" },

  resultBox: {
    marginTop: "20px",
    padding: "20px",
    border: "1px solid #00ff99",
    background: "#001100",
  },

  resultTitle: {
    fontSize: "20px",
    marginBottom: "12px",
    textShadow: "0 0 10px #00ff99",
  },

  text: {
    fontSize: "16px",
    marginBottom: "10px",
  },
};

export default App;
